        .flex {
            position: relative;
            height: 50vh;
            width: 80vw;
            border: 2px solid black;
            border-radius: 5px;
            color: white;
}

        .flex h1 {
            position: absolute;
            color: white;
            top: 10%;
            width: 100%;
            text-align: center;
            font-size: 3vw;
            font-family: Comic Sans MS;
        }

        .flex table {
            position: absolute;
            color: white;
            top: 50%;
            width: 100%;
            text-align: center;
            font-size: 2vw;
            font-family: Comic Sans MS;
        }
        
        .left {
            border: 2px white;
            height: 40vh;
            width: 40vw;
            position: absolute;
        }
